import React from "react";
import { NFT } from '@web3-ui/components';

function Tokens({number}) {

  return (
    <div className="flex flex-row grid grid-cols-5 gap-1 text-center w-full text-3xl font-semibold">
      {/* Bored Ape */}
      <NFT contractAddress="0xbc4ca0eda7647a8ab7c2061c2e118a18a936f13d" tokenId={number} />
      {/* Moonbird */}
      <NFT contractAddress="0x23581767a106ae21c074b2276d25e5c3e136a68b" tokenId={number} />
      {/* Goopdoods */}
      <NFT contractAddress="0x2dff22dcb59d6729ed543188033ce102f14ef0d1" tokenId={number} />
      {/* Tiny Dinos */}
      <NFT contractAddress="0xd9b78a2f1dafc8bb9c60961790d2beefebee56f4" tokenId={number} />
      {/* ChainRunner */}
      <NFT contractAddress="0x97597002980134bea46250aa0510c9b90d87a587" tokenId={number} />
    </div>
  );
}

export default Tokens;
